import React, { Component } from 'react';
import L from 'leaflet';
import icon from 'leaflet/dist/images/marker-icon.png';
import iconShadow from 'leaflet/dist/images/marker-shadow.png';
import ImovelMarker from './ImovelMarker';

let DefaultIcon = L.icon({
    iconUrl: icon,
    shadowUrl: iconShadow
});

L.Marker.prototype.options.icon = DefaultIcon;

class ImovelMarkers extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <ImovelMarker condominio={imovel.condominio} rua={imovel.rua} numero={imovel.numero} 
                          bairro={imovel.bairro} lat={imovel.lat} lng={imovel.lng}/>
        )
    }
}

export default ImovelMarkers;
